import React from "react";

function PersonForm(props) {
  return (
    <>
      <form>
        <div>
          <input
            type="text"
            value={props.value}
            onChange={props.onChange}
            id={props.id}
            name={props.name}
          />
        </div>
        <button type="submit">Update</button>
      </form>
    </>
  );
}

export default PersonForm;
